pragma solidity ^0.8.0;

contract ChesSR {
    // defining a owner
    address public owner;
    mapping(string => bool) public roomIdExistence;
    string[] roomIds;
    //list of contestant
    mapping(string => Room) public contests;

    // making a constructor payable makes contract eligible to hold ether
    constructor() payable{
        //following line is owner is the same address which deploying on blockchain
        owner = msg.sender;
    }

    //change owner. FYI put a condition so that only owner himself can assign someone as owner
    function changeOwner(address newOwner) public {
        //checking that this method or task can be done by owner only
        require(msg.sender == owner, "Only Owner can change owner !!!");
        owner = newOwner;
    }

    struct Room {
        string roomId;
        uint256 betAmount;
        address payable[] players;
    }

    //get List of rooms
    function getRoomList() public view returns (Room[] memory){
        Room[] memory rooms ;
        for (uint i=0;i<roomIds.length; i++){
            string memory roomId = roomIds[i];
            rooms[i]= contests[roomId];
        }
        return rooms;
    }

    //modifier are like sub function
    modifier creatingRoom(string memory roomId,uint betAmount,address payable playerAddress){
        require(msg.value >= 100 wei);

        Room storage room = contests[roomId];
        room.roomId = roomId;
        if(room.betAmount == 0){
            room.betAmount = betAmount;
        } else{
            if(betAmount!=room.betAmount){
                revert("Bet Amount is not same");
            }
        }

        if(room.players.length < 2){
            room.players.push(playerAddress);
        } else{
            revert("Room is already filled");
        }

        contests[roomId] =room;
        require(!roomIdExistence[roomId]);
        roomIds.push(roomId);
        roomIdExistence[roomId] = true;
        _;
    }

    //deposit funds to contract. Calling this method automatically deposit ether in to contract
    //whatever value we give it automatically goes in msg.value and calling this method makes the deposit
    function deposit(string memory roomId, uint betAmount,address payable playerAddress) external payable creatingRoom(roomId, betAmount,playerAddress) returns (bool){
        return true;
    }

    //funds transfer to specific address from contract
    function transfer(address payable receiver, uint256 amount) public returns (bool){
        //checking if transfer funds are not greater than contract funds
        require(address(this).balance >= amount, "Insufficient funds");
        receiver.transfer(amount);
        return true;
    }

    //Check contract balance
    function checkBalance() public view returns (uint256){
        return (address(this).balance);
    }

